var minWidth = {
    minWidth: "100%"
};

var innerStyle = {
    minWidth: "100%",
    paddingBottom: "18px"
};

var tableStyle = {
    minWidth: "100%",
    borderTop: "2px solid #ddd"
};

function FinePrint() {
  return (

<table>
    <tbody>
        <tr>
            <td>
                <table>
                    <tbody>
                        <tr>
                        <td style="color:#656565;font-size:12px;text-align:center">

                            <em>Copyright Â© 2019 FPR, All rights reserved.</em>
   <br/>
    You are receiving this email because you have subscribed to our weekly newsletter. To unsubscribe, please reply with 'unsubscribe'.
    <br/>
    <br/>
    <strong>Our address is:</strong>
    <br/>

    <div>
        <span>Vape Craft inc.</span>
        <div>
            <div>2322 La Mirada Dr.</div>
            <span>Vista</span>, <span>CA</span>  <span>92081</span>
        </div>
        <br/>
    </div>

    <br/>
    <br/>
                        </td>
                    </tr>
                </tbody>
            </table>
            </td>
        </tr>
    </tbody>
</table>

  );
}

export default FinePrint;
